filter &lt;- c("Germany", "India", "Netherlands", "Canada", "Australia")

getCountry &lt;- function(x, country){
  countries_select &lt;- data.frame()
  for(i in 1:length(x)){
    if(x[[i]]$location[[1]] %in% country){
      return (x[[i]])
    } else {
      next
    }
  }
  return (countries_select)
}
